import { createSlice } from "@reduxjs/toolkit";
import { UsersData } from "../FakeData";

const initialState = {
    value: UsersData
};

const usersSlice = createSlice({
    name: "users",
    initialState,
    reducers: {
        addUsers
    }
});

export default usersSlice.reducer;
